const pic1 = 'data:image/png;base64,'
const pic2 = 'data:image/png;base64,'
const pic3 = 'data:image/png;base64,'
const pic4 = 'data:image/png;base64,'
// 获取canvas宽度，计算图片位置
var chartWidth = myChart.getWidth()
const picList = [{
    name: '软科',
    pic: pic1
}, {
    name: '医学类',
    pic: pic2
}, {
    name: '区内高校',
    pic: pic3
}, {
    name: '最好大学',
    pic: pic4
}];
var data = {
    area: ['2016', '2017', '2018', '2019', '2020'],
    legend: ['软科', '医学类', '区内高校', '最好大学'],
    data: [
        // 每列值
        [90, 450, 0, 145, 140],
        [6, 28, 26, 25, 23],
        [72, 70, 68, 64, 50],
        [155, 150, 149, 145, 140]
    ]
}
// 每列最大值
var calcMaxArray = [900, 64, 109, 900]


// 获取canvas宽度，计算图片位置
var chartWidth = myChart.getWidth()

var leftList = [27, 22, 15, 15]

// 添0，顶上，让右下网格顶上，颜色叠加效果
data.area.push(0)
data.data.push(0)
// 右下网格左右留白，右下x轴设置最大80，每20一个间隔，将数值全部转化成20内
var emptyData = data.data.map(item => {
    return [2, 2, 2, 2, 2]
})

// graphic图片初始化
var optionElements = picList.map((item, index) => {
    // 计算图片位置
    let leftPercent = 90 / chartWidth * 100 / 2
    return {

        type: 'group',
        // 详情一列宽度 20.75% 
        left: 25.5 + -leftPercent + 20.75 * index + '%',
        top: '3%',
        children: [{
                type: 'image',
                style: {
                    image: item.pic,
                    width: 90,
                    height: 80,
                }
            },
            {
                type: 'text',
                style: {
                    text: item.name,
                    // 图标无法给百分比，故文字与图标写死位置，待寻找更好方案
                    y: 100,
                    x: leftList[index],
                    fill: '#fff',
                    textShadowColor: '#00EAFF',
                    textShadowBlur: 8,
                    fontSize: 15
                }
            }
        ]

    }
})
var emptyBarData = data.area.map(item => {
    return {
        name: item,
        value: 80,
    }
})
var emptyBarData2 = data.area.map(item => {
    return {
        name: item,
        value: Number(item) * 2
    }
})
// 将每列的值按每列最大值比例转化成20内的数据
var turnData = calcMaxArray.map((max, index) => {
    return data.data[index].map((item, id) => {
        return {
            value: item * 16 / max > 16 ? 16 : item * 16 / max,
            name: data.area[id % data.data[index].length],
            itemStyle: {
                color: new echarts.graphic.LinearGradient(1, 0, 0, 0, [{
                    offset: 0,
                    color: 'rgba(0, 204, 255, 1)'
                }, {
                    offset: 1,
                    color: 'rgba(101, 105, 255, 1)'
                }]),
                barBorderRadius: [5, item === max ? 5 : 0, item === max ? 5 : 0, 5]
            },
        }
    })
})
// 将计算转换20内得出的结果用20减去，模拟柱最大值背景
var restData = turnData.map((item, index) => {

    return item.map((item, id) => {
        return {
            total: calcMaxArray[index],
            current: data.data[index] && data.data[index][id],
            value: 16 - item.value > 16 ? 16 : 16 - item.value,
            name: data[id % data.data.length],
            itemStyle: {
                color: 'rgba(59, 126, 170, 0.3)',
                barBorderRadius: [item.value == 0 ? 5 : 0, 5, 5, item.value == 0 ? 5 : 0]
            }
        }
    })
})
// 柱图黄色箭头
var markPointData = turnData.map((item, index) => {
    let b = item.map((it, id) => {
        let a = {
            name: 1,
            value: 1,
            xAxis: 20 * index + 2 + it.value,
            yAxis: data.area[parseInt(id % data.area.length)],
            label: {
                position: 'right',
                show: true,
                offset: [0, 0],
                formatter: params => {
                    return `{trangle|▼}`
                },
                rich: {
                    line: {
                        color: 'rgba(28, 234, 246, 0.3)',
                    },
                    trangle: {
                        fontSize: 16,
                        color: '#FFFB8F',
                        lineHeight: 10,
                        padding: [30, 0, 0, -14],
                        textShadowBlur: 15,
                        textShadowColor: '#FFFB8F'
                    }
                }
            }
        }
        return a;
    })
    return b
})
// 柱数值展示
var markPointData2 = turnData.map((item, index) => {
    let b = item.map((it, id) => {
        let a = {
            name: 1,
            value: 1,
            current: data.data[index][id],
            total: calcMaxArray[index],
            xAxis: 10 + 20 * index,
            yAxis: data.area[parseInt(id % data.area.length)],
            label: {
                offset: [-35, 0],
                position: 'right',
                show: true,
                formatter: params => {
                    return `{current|${params.data.current}}\n{hr|}\n{total|${params.data.total}}`
                },
                rich: {
                    trangle: {
                        fontSize: 16,
                        color: '#FFFB8F',
                        lineHeight: 10,
                        padding: [0, 0, 0, -4],
                        textShadowBlur: 15,
                        textShadowColor: '#FFFB8F'
                    },
                    hr: {
                        backgroundColor: 'rgba(59, 126, 170, 1)',
                        width: 60,
                        height: 1,
                    },
                    current: {
                        fontSize: 20,
                        color: '#FFFFFF',
                        align: 'center',
                        width: 60,
                        padding: [7, 0, 0, 0]
                    },
                    total: {
                        fontSize: 13,
                        color: 'rgba(0, 186, 255, 1)',
                        width: 60,
                        align: 'center',
                        padding: [120, 0, 7, 0],
                    }
                }
            }
        }
        return a;
    })
    return b
})

// 用grid模拟虚线
var gridLine = new Array(8).fill().map((item, index) => {
    let left = index < 4 ? '4%' : 2 + Math.floor(index / 4) * 13 + '%';
    let top = 2 + 16 * (index % 4 + 2) + '%';
    let width = index >= 4 ? 83 + '%' : 8 + '%'
    return {
        left,
        top,
        height: 0,
        width,
        backgroundColor: 'transparent',
        borderColor: 'rgba(10, 132, 197, 0.7)',
        borderType: 'dashed',
        borderWidth: 0.4,
        show: true,
    }
})

var option = {
    backgroundColor: '#000',
    tooltip: {
        show: false
    },
    // 网格设置
    grid: [{
        top: '2%',
        height: '16%',
        left: '14%',
        right: '2%',
        backgroundColor: 'rgba(14, 106, 154, 0.2)',
        show: true,
        borderColor: 'transparent',
    }, {
        top: '2%',
        bottom: '2%',
        left: '2%',
        width: '12%',
        show: true,
        borderColor: 'transparent',
    }, {
        top: '2%',
        bottom: '2%',
        left: '15%',
        right: '2%',
    }, {
        top: '18%',
        left: '2%',
        width: '12%',
        height: 1,
        backgroundColor: 'rgba(10, 132, 197, 1)',
        borderColor: 'transparent',
        show: true,
    }, ...gridLine],
    // x轴
    xAxis: [{
            gridIndex: 0,
            type: 'value',
            show: true,
            axisLine: {
                lineStyle: {
                    color: 'rgba(10, 132, 197, 1)'
                }
            }
        },
        {
            gridIndex: 1,
            type: 'value',
            show: false,
            max: Math.max(...data.area)
        },
        {
            gridIndex: 2,
            type: 'value',
            axisLabel: {
                color: 'rgba(153, 153, 153, 1)',
                show: false
            },
            axisLine: {
                show: false,
                lineStyle: {
                    color: 'rgba(142, 142, 142, 1)'
                },
                // width: 5
            },
            axisTick: {
                show: false,
            },
            splitArea: {
                show: true,
                areaStyle: {
                    color: ['transparent', 'rgba(14, 106, 154, 0.15)']
                }
            },
            splitLine: {
                show: false
            }
        }
    ],
    // y轴
    yAxis: [{
            gridIndex: 0,
            type: 'category',
            show: false,
        }, {
            gridIndex: 1,
            type: 'category',
            show: true,
            data: data.area,
            splitArea: {
                show: true,
                areaStyle: {
                    color: ['rgba(14, 106, 154, 0.2)']
                }
            },
            axisTick: {
                show: false,
            },
            axisLabel: {
                show: false
            },
            axisLine: {
                show: false
            }
        },
        {
            gridIndex: 2,
            show: true,
            type: 'category',
            data: data.area,
            axisTick: {
                show: false,
            },
            axisLabel: {
                show: false
            },
            axisLine: {
                show: false
            },

            splitLine: {
                show: false,
                lineStyle: {
                    color: 'rgba(28, 234, 246, 0.3)',
                    type: 'dashed'
                }
            }
        }
    ],
    series: [{
            type: 'bar',
            xAxisIndex: 1,
            yAxisIndex: 1,
            name: '左下角挤下去',
            barWidth: 50,
            silent: true,
            itemStyle: {
                color: 'transparent'
            },
            data: emptyBarData2
        },
        {
            type: 'bar',
            xAxisIndex: 1,
            yAxisIndex: 1,
            data: data.area,
            label: {
                show: true,
                formatter: params => {
                    console.log(params.data)
                    if (params.data === 0) {
                        return ''
                    } else {
                        return params.data
                    }
                },
                position: 'top',
                color: 'rgba(0, 186, 255, 1)',
                fontSize: 15
            },
            symbolSize: 0.001,
            itemStyle: {
                normal: {
                    color: 'transparent'
                }
            }
        },
        {
            type: 'bar',
            xAxisIndex: 2,
            yAxisIndex: 2,
            name: '右下角挤下去',
            barWidth: 70,
            silent: true,
            itemStyle: {
                color: 'transparent'
            },
            data: emptyBarData
        }
    ]
};
for (var i = 0; i < data.legend.length; i++) {
    // ←左间隔
    option.series.push({
        xAxisIndex: 2,
        yAxisIndex: 2,
        name: data.legend[i],
        type: 'bar',
        stack: '总量',
        barWidth: 10,
        label: {
            show: false,
        },
        itemStyle: {
            barBorderRadius: 5,
            color: 'transparent'
        },
        data: emptyData[i]
    })
    // 左边有颜色柱
    option.series.push({
        xAxisIndex: 2,
        yAxisIndex: 2,
        name: data.legend[i],
        type: 'bar',
        stack: '总量',
        barWidth: 10,
        label: {
            show: false,
        },
        markPoint: {
            silent: true,
            symbolSize: 0.01,
            data: [...markPointData[0], ...markPointData[1], ...markPointData[2], ...markPointData[3]]
        },
        data: turnData[i]
    })
    // 右边背景柱
    option.series.push({
        xAxisIndex: 2,
        yAxisIndex: 2,
        name: data.legend[i],
        type: 'bar',
        stack: '总量',
        barWidth: 10,
        label: {
            show: false,
        },
        data: restData[i],
        markPoint: {
            silent: true,
            symbolSize: 0.01,
            data: [...markPointData2[0], ...markPointData2[1], ...markPointData2[2], ...markPointData2[3]]
        }
    })
    // →右间隔
    option.series.push({
        xAxisIndex: 2,
        yAxisIndex: 2,
        name: data.legend[i],
        type: 'bar',
        stack: '总量',
        barWidth: 10,
        label: {
            show: false,
        },
        itemStyle: {
            barBorderRadius: 5,
            color: 'transparent'
        },
        data: emptyData[i]
    })
}
option.graphic = {
    elements: optionElements
}
myChart.setOption(option);